import Row from "../components/row"
import { useState, useMemo, useEffect } from "react";

export default function Index() {
    const [url, setUrl] = useState();
    const [resItems, setResItems] = useState();

    const handleClickLoading = ()=>
    {
       setUrl("https://api.giphy.com/v1/gifs/random?api_key=dc6zaTOxFJmzC&tag=сats")
        alert("Loading")
    }
    const handleClickClear = ()=>
    {
        alert("Clear")
    }
    const handelClickGroup = ()=>
    {
        alert("Group")
    }

    useEffect(() => {
         fetch(
           url
         )
           .then(response => response.json())
           .then(data => setResItems(data));
           alert("zagruzil")
       }, [url]);
    return (
      <div>
        <Row onClickLoading={handleClickLoading} onClickClear={handleClickClear} onClickGroup={handelClickGroup}/>

        {resItems.map(item => (
          <Card item={item} key={`${item.id}:${item.firstName}-${item.lastName}`} />
        ))}

      </div>
    );
  }
